  "translationLines": [
    {
      "lineNumber": 17841,
      "originalJapaneseLine": "　お前、知らんのなら引っ込んでいろ！」",
      "translatedEnglishLine": "If you don't know, then stay out of it!"
    },
    {
      "lineNumber": 17842,
      "originalJapaneseLine": "「そんなにデリケートな舌でもないだろうに」",
      "translatedEnglishLine": "You're not such a delicate tongue, are you?"
    },
    {
      "lineNumber": 17843,
      "originalJapaneseLine": "「ええい、やかましい……！",
      "translatedEnglishLine": "Ugh, you're so noisy...!"
    },
    {
      "lineNumber": 17844,
      "originalJapaneseLine": "　そんなに言うなら貴様が食え！」",
      "translatedEnglishLine": "If you talk so much, then you eat it!"
    },
    {
      "lineNumber": 17845,
      "originalJapaneseLine": "「そうか？　では失礼する」",
      "translatedEnglishLine": "Is that so? Then, if you'll excuse me."
    },
    {
      "lineNumber": 17846,
      "originalJapaneseLine": "「あっ」",
      "translatedEnglishLine": "Ah!"
    },
    {
      "lineNumber": 17847,
      "originalJapaneseLine": "「あ……」",
      "translatedEnglishLine": "Ah..."
    },
    {
      "lineNumber": 17848,
      "originalJapaneseLine": "ピッテンはこともなげに、",
      "translatedEnglishLine": "Pitten casually—"
    },
    {
      "lineNumber": 17849,
      "originalJapaneseLine": "香姫の皿の上の団子をひょいと一口。",
      "translatedEnglishLine": "Snatched a dango from Kamihime's plate in one bite."
    },
    {
      "lineNumber": 17850,
      "originalJapaneseLine": "「………………！」",
      "translatedEnglishLine": "........!"
    },
    {
      "lineNumber": 17851,
      "originalJapaneseLine": "「あ、あの……」",
      "translatedEnglishLine": "Um, excuse me..."
    },
    {
      "lineNumber": 17852,
      "originalJapaneseLine": "そのまま、有無を言わさずひょいひょいと、",
      "translatedEnglishLine": "Without letting her say anything, he quickly—"
    },
    {
      "lineNumber": 17853,
      "originalJapaneseLine": "残りも口の中に放り込む。",
      "translatedEnglishLine": "threw the rest into his mouth."
    },
    {
      "lineNumber": 17854,
      "originalJapaneseLine": "「んっ！　…………ふう。",
      "translatedEnglishLine": "\"Mm! ...Phew."
    },
    {
      "lineNumber": 17855,
      "originalJapaneseLine": "　すまんな、腹が減っていたので",
      "translatedEnglishLine": "Sorry, I was really hungry,"
    },
    {
      "lineNumber": 17856,
      "originalJapaneseLine": "　まとめて食ってしまった」",
      "translatedEnglishLine": "so I just ate it all at once.\""
    },
    {
      "lineNumber": 17857,
      "originalJapaneseLine": "「い、いえ。ええと、その……」",
      "translatedEnglishLine": "\"N-no, um, well...\""
    },
    {
      "lineNumber": 17858,
      "originalJapaneseLine": "「変わった味だが、美味かった。",
      "translatedEnglishLine": "\"It's an unusual flavor, but it was delicious."
    },
    {
      "lineNumber": 17859,
      "originalJapaneseLine": "　次はもう少し基本に立ち返ったものがいいかな」",
      "translatedEnglishLine": "Next time, maybe something a bit more traditional would be good.\""
    },
    {
      "lineNumber": 17860,
      "originalJapaneseLine": "「あっ……は、はいっ……」",
      "translatedEnglishLine": "\"Ah... y-yes...\""
    },
    {
      "lineNumber": 17861,
      "originalJapaneseLine": "香姫は少し嬉しそうに会釈して、",
      "translatedEnglishLine": "Kamihime gave a slightly pleased bow,"
    },
    {
      "lineNumber": 17862,
      "originalJapaneseLine": "そのまま去っていった。",
      "translatedEnglishLine": "and then left."
    },
    {
      "lineNumber": 17863,
      "originalJapaneseLine": "「…………………………」",
      "translatedEnglishLine": "......................."
    },
    {
      "lineNumber": 17864,
      "originalJapaneseLine": "「ぐ……………は…………！」",
      "translatedEnglishLine": "\"Ugh... ha...!\""
    },
    {
      "lineNumber": 17865,
      "originalJapaneseLine": "「やっぱりか。やせ我慢しやがって、アホが」",
      "translatedEnglishLine": "\"I knew it. Pretending to be tough, you idiot.\""
    },
    {
      "lineNumber": 17866,
      "originalJapaneseLine": "「…………腹ではなく、直接脳天を攻められるとは、",
      "translatedEnglishLine": "\"...Not my stomach, but directly attacked on the top of my head—"
    },
    {
      "lineNumber": 17867,
      "originalJapaneseLine": "　流石に予想外だ…………」",
      "translatedEnglishLine": "that's really unexpected...\""
    },
    {
      "lineNumber": 17868,
      "originalJapaneseLine": "流れる脂汗を止められず、",
      "translatedEnglishLine": "Unable to stop the dripping sweat,"
    },
    {
      "lineNumber": 17869,
      "originalJapaneseLine": "ピッテンは廊下の壁にもたれかかった。",
      "translatedEnglishLine": "Pitten leaned against the hallway wall."
    },
    {
      "lineNumber": 17870,
      "originalJapaneseLine": "「ええかっこしいには良い薬だ。",
      "translatedEnglishLine": "\"That's a good medicine for show-offs."
    },
    {
      "lineNumber": 17871,
      "originalJapaneseLine": "　これに懲りたら口を挟むんじゃないぞ」",
      "translatedEnglishLine": "If you learn from this, don't butt in again.\""
    },
    {
      "lineNumber": 17872,
      "originalJapaneseLine": "「ふ……年少者の顔が曇るのを放置するのは、",
      "translatedEnglishLine": "\"Hmph... I just can't leave a young person's expression clouded over..."
    },
    {
      "lineNumber": 17873,
      "originalJapaneseLine": "　性に合わなくてな……」",
      "translatedEnglishLine": "It's just not in my nature.\""
    },
    {
      "lineNumber": 17874,
      "originalJapaneseLine": "「は？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 17875,
      "originalJapaneseLine": "「昔……一生分やったんでな。",
      "translatedEnglishLine": "\"A long time ago... I did my share for a lifetime."
    },
    {
      "lineNumber": 17876,
      "originalJapaneseLine": "　もう、見る気がない」",
      "translatedEnglishLine": "I have no desire to see it anymore.\""
    },
    {
      "lineNumber": 17877,
      "originalJapaneseLine": "「ふーん、わけ分からんな。",
      "translatedEnglishLine": "\"Hmm, I don't get it."
    },
    {
      "lineNumber": 17878,
      "originalJapaneseLine": "　まあ、往生しろ」",
      "translatedEnglishLine": "Well, good luck with that.\""
    },
    {
      "lineNumber": 17879,
      "originalJapaneseLine": "「ここで果てるわけにはいかん……",
      "translatedEnglishLine": "\"I can't die here..."
    },
    {
      "lineNumber": 17880,
      "originalJapaneseLine": "　養生、しよう…………っ、ぐ」",
      "translatedEnglishLine": "I have to recover... ugh.\""
    },
    {
      "lineNumber": 17881,
      "originalJapaneseLine": "再び苦痛の波がやってきて、",
      "translatedEnglishLine": "Once again, a wave of pain came,"
    },
    {
      "lineNumber": 17882,
      "originalJapaneseLine": "ピッテンはそれに耐えるために目を閉じた。",
      "translatedEnglishLine": "and Pitten closed his eyes to endure it."
    },
    {
      "lineNumber": 17883,
      "originalJapaneseLine": "「――――すまん。ちょっと邪魔をするぞ」",
      "translatedEnglishLine": "\"...Sorry. I'll be a little intrusive.\""
    },
    {
      "lineNumber": 17884,
      "originalJapaneseLine": "「あぁ？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 17885,
      "originalJapaneseLine": "玉座の間に、唐突にピッテンがやってきた。",
      "translatedEnglishLine": "Suddenly, Pitten showed up in the throne room."
    },
    {
      "lineNumber": 17886,
      "originalJapaneseLine": "「少し、面倒事があってな……",
      "translatedEnglishLine": "\"I've got a bit of trouble going on..."
    },
    {
      "lineNumber": 17887,
      "originalJapaneseLine": "　ここで一息つけさせてくれ」",
      "translatedEnglishLine": "Let me catch my breath here."
    },
    {
      "lineNumber": 17888,
      "originalJapaneseLine": "「なんだ金ぴか野郎。",
      "translatedEnglishLine": "\"What is it, you flashy guy?"
    },
    {
      "lineNumber": 17889,
      "originalJapaneseLine": "　人の王座を休憩所代わりにするんじゃない」",
      "translatedEnglishLine": "Don't use someone's throne as your resting place."
    },
    {
      "lineNumber": 17890,
      "originalJapaneseLine": "「ここくらいしか手近な場所がなくてな。",
      "translatedEnglishLine": "\"This is about the only place nearby."
    }
  ]
}

